column8:
このミラーを装着するだけで、車全体がレーシーな雰囲気に！純正では決して味わうことの出来ない印象的なデザインが特徴の、軽量コンパクトなＧＴ1タイプ。人気のＬＥＤウインカーを内臓！鮮やかなオレンジに発光。<br><br>モーターを排除することで軽量化。手動タイプでミラーレンズは固定となります。<br><br>●カラー：カーボン調 ●左ハンドル車用 <br><br><br>適合車種：ルノー スーパー5 [1990～1991]<br><br>ボディパーツ | ドアミラー<br>ルノー | スーパー5 | 全モデル<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


