SuperSportMirrorシリーズのフラッグシップモデル。跳ね上がるように格納することが出来ます。ミラーレンズには夜間走行時での後続車のヘッドライトから視界を守るブルーミラーレンズを採用。<br><br>手動により格納できます。ミラー面は電動で動かすことが出来ます。(取付には配線の加工が必要になります。）<br><br>●カラー：マテリアルブラック　●手動格納機構　●ブルーミラーレンズ　●ミラーレンズ電動調整式　●左ハンドル車用<br><br><br>適合車種：ルノー ルーテシア(クリオ) ルーテシア(クリオ)2 [1998～2005]<br><br>ボディパーツ | ドアミラー<br>ルノー | ルーテシア(クリオ) | ルーテシア(クリオ)１<tr><td colspan="2">
